void st7735_flush_cb_spi_byte_by_byte(int x1, int y1, int x2, int y2, lv_color_t *color_map)
{
    // Set window 160 x 128 for landscape mode
    st7735_set_address_window(x1, y1, x2, y2);

    // Send pixel data (RGB565 format)
    int total_pixels = (x2 - x1 + 1) * (y2 - y1 + 1);
    for (int i = 0; i < total_pixels; i++) {
        lv_color_t color = color_map[i];
        uint16_t color16 = color.full;  // Extract the raw 16-bit RGB565 value
        st7735_send_data(color16 >> 8); // High byte
        st7735_send_data(color16 & 0xFF); // Low byte
    }
}

/**********************
 * LVGL flush callback
 **********************/
static void st7735_flush_cb(lv_disp_drv_t *disp, const lv_area_t *area, lv_color_t *color_p)
{
    int32_t w = area->x2 - area->x1 + 1;
    int32_t h = area->y2 - area->y1 + 1;

    // st7735_flush_cb_spi_byte_by_byte(area->x1, area->y1, w, h, color_p);
    st7735_flush_cb_spi_buffer(area->x1, area->y1, w, h, color_p);

    lv_disp_flush_ready(disp);  // Tell LVGL we're done
}

/**********************
 * LVGL Task to Updte/Refresh the display
 **********************/
void lvgl_task(void *pvParameter)
{
    ESP_LOGI(TAG, "Starting LVGL Task...");
    
    while (1) {
        vTaskDelay(pdMS_TO_TICKS(LV_TICK_PERIOD_MS)); // Yield to avoid WDT reset
        lv_task_handler();   // LVGL tasks (animations, redraw) 
        // lv_refr_now(NULL); // Immediate refresh
        // lv_tick_inc(LV_TICK_PERIOD_MS); // Increment LVGL tick
    }
}

/**********************
 * Main application
 **********************/
void app_main(void)
{
    ESP_LOGI(TAG, "Initializing Display SPI Drivers...");
    st7735_init();
    // ili9488_init();

    // Rotate the display if needed
    st7735_set_rotation(ST7735_ROTATION_270);
    vTaskDelay(pdMS_TO_TICKS(500)); // Wait for the display to stabilize

    st7735_fill_screen_white();
    vTaskDelay(pdMS_TO_TICKS(500)); // Wait for the display to stabilize

    st7735_fill_screen(0xf800);
    vTaskDelay(pdMS_TO_TICKS(500)); // Wait for the display to stabilize

    st7735_fill_screen(0xff00);
    vTaskDelay(pdMS_TO_TICKS(500)); // Wait for the display to stabilize

    ESP_LOGI(TAG, "Initializing LVGL...");
    lv_init();

    /**********************
     * Display buffer
     **********************/
    static lv_disp_draw_buf_t draw_buf;
    static lv_color_t buf1[ST7735_DISPLAY_BUFFER_SIZE];
    
    // Initialize the draw buffer
    lv_disp_draw_buf_init(&draw_buf, buf1, NULL, ST7735_DISPLAY_SIZE);
    
    // Register the display driver with LVGL
    static lv_disp_drv_t disp_drv;
    lv_disp_drv_init(&disp_drv);
    disp_drv.hor_res = ST7735_DISP_HOR_RES;
    disp_drv.ver_res = ST7735_DISP_VER_RES;
    disp_drv.rotated = 1;                   // Set the display rotation if needed
    disp_drv.flush_cb = st7735_flush_cb;    // Your flush function
    disp_drv.draw_buf = &draw_buf;
    lv_disp_drv_register(&disp_drv);

    // Fill background with green
    lv_obj_set_style_bg_color(lv_scr_act(), lv_color_hex3(COLOR_GREEN), LV_PART_MAIN);
    
    // Example for displaying C Array image 
    // lv_example_img_1();
    lv_example_img_2();
    /* Start LVGL task */
    xTaskCreatePinnedToCore(lvgl_task, "lvgl_task", 1024 * 16, NULL, 1, NULL, 1);

}